import "./MiCuenta.css";
const MiCuenta = () => {
  return (
    <>
      <h1>Pure CSS modal box</h1>
      <div>
        <p>You can place trigger button wherever you want.</p>
        <label class="btn" for="modal-1">
          Show me modal with a cat
        </label>
      </div>
    </>
  );
};

export default MiCuenta;
